import React from 'react';
import { StyleSheet, Text, View, ScrollView, Image, FlatList, Dimensions, Platform } from 'react-native';

// --- DATA ---
// Data extracted from your resume to populate the portfolio
const featured = {
  name: "Narayanasamy A",
  role: "iOS Developer | Swift | SwiftUl",
  summary: "iOS Developer with 2+ years of experience in Swift and SwiftUl mobile app development. Delivered scalable cross-platform applications serving 400,000+ users worldwide. Specialized in real-time messaging, Al integration, performance optimization, and data persistence solutions."
};

const workExperience = [
  {
    company: "FREELANCER",
    role: "iOS Developer",
    period: "July 2023 - Present",
    description: "Developed mEinsteinAl chat application with real-time messaging and Al-powered features. Implemented voice interaction and offline storage using CoreData with performance optimization. Applied MVVM architecture and integrated push notifications using Agile development."
  },
  {
    company: "Fusion Innovative Limited",
    role: "iOS Developer",
    period: "February 2023 - June 2023",
    description: "Built order tracking module for Fusion Kitchen food delivery app. Implemented real-time tracking using SwiftUl and Firebase with performance optimization. Collaborated on multiple client apps using Agile methodology."
  },
  {
    company: "Webandcrafts",
    role: "Jr. iOS Developer",
    period: "March 2022 - February 2023",
    description: "Enhanced IKEA mobile app serving 400,000+ users worldwide - developed login and OTP screens. Built home page for Lulu Shopping app using SwiftUl framework with performance optimization."
  },
];

const skills = [
  {
    category: "Languages",
    list: "Swift, Objective-C, Java, JSON",
  },
  {
    category: "Frameworks & Libraries",
    list: "UIKit, CoreData, Realm, Combine, Alamofire, Firebase",
  },
  {
    category: "Architecture & Tools",
    list: "MVVM, The Composable Architecture (TCA), Xcode, Git, Jira, Version Control, Cursor AI",
  },
];

// --- COMPONENTS ---
const screenWidth = Dimensions.get('window').width;

const Header = () => (
  <View style={styles.header}>
    <Text style={styles.logo}>NS.</Text>
  </View>
);

const Hero = ({ data }) => (
  <View style={styles.heroSection}>
    <Image
      source={{ uri: 'https://images.unsplash.com/photo-1534972195531-d756b9bfa9f2?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80' }}
      style={styles.heroImage}
    />
    <View style={styles.heroContent}>
      <Text style={styles.heroTitle}>{data.name}</Text>
      <Text style={styles.heroSubtitle}>{data.role}</Text>
      <Text style={styles.heroSummary}>{data.summary}</Text>
    </View>
  </View>
);

const SectionRow = ({ title, data, renderItem }) => (
  <View style={styles.sectionContainer}>
    <Text style={styles.sectionTitle}>{title}</Text>
    <FlatList
      horizontal
      data={data}
      renderItem={renderItem}
      keyExtractor={(item, index) => index.toString()}
      showsHorizontalScrollIndicator={false}
      contentContainerStyle={styles.rowList}
      snapToInterval={screenWidth * 0.8 + 10} // Snap to card width for smooth scrolling
      decelerationRate="fast"
    />
  </View>
);

const WorkCard = ({ item }) => (
  <View style={styles.card}>
    <Text style={styles.cardTitle}>{item.company}</Text>
    <Text style={styles.cardSubtitle}>{item.role}</Text>
    <Text style={styles.cardPeriod}>{item.period}</Text>
    <Text style={styles.cardDescription}>{item.description}</Text>
  </View>
);

const SkillsCard = ({ item }) => (
  <View style={styles.card}>
    <Text style={styles.cardTitle}>{item.category}</Text>
    <Text style={styles.cardDescription}>{item.list}</Text>
  </View>
);

// --- MAIN APP COMPONENT ---
export default function App() {
  return (
    <View style={styles.container}>
      <ScrollView>
        <Header />
        <Hero data={featured} />

        <SectionRow
          title="Work Experience"
          data={workExperience}
          renderItem={({ item }) => <WorkCard item={item} />}
        />

        <SectionRow
          title="Technical Skills"
          data={skills}
          renderItem={({ item }) => <SkillsCard item={item} />}
        />
      </ScrollView>
    </View>
  );
}

// --- STYLES ---
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#141414',
  },
  header: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    zIndex: 100,
    padding: 20,
    backgroundColor: 'rgba(20, 20, 20, 0.7)',
  },
  logo: {
    color: '#E50914',
    fontSize: 28,
    fontWeight: 'bold',
  },
  heroSection: {
    height: 500,
    justifyContent: 'flex-end',
  },
  heroImage: {
    ...StyleSheet.absoluteFillObject,
    opacity: 0.3,
  },
  heroContent: {
    padding: 20,
    position: 'relative',
    zIndex: 10,
  },
  heroTitle: {
    color: '#fff',
    fontSize: 48,
    fontWeight: 'bold',
  },
  heroSubtitle: {
    color: '#ccc',
    fontSize: 24,
  },
  heroSummary: {
    color: '#ccc',
    marginTop: 10,
    lineHeight: 20,
    maxWidth: '80%',
  },
  sectionContainer: {
    paddingVertical: 20,
    paddingLeft: 20,
  },
  sectionTitle: {
    color: '#fff',
    fontSize: 22,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  rowList: {
    paddingRight: 20,
  },
  card: {
    backgroundColor: '#222',
    borderRadius: 8,
    padding: 15,
    marginRight: 10,
    width: screenWidth * 0.8, // Each card takes up 80% of the screen width
  },
  cardTitle: {
    color: '#fff',
    fontSize: 18,
    fontWeight: 'bold',
  },
  cardSubtitle: {
    color: '#ccc',
    fontSize: 16,
    fontWeight: '600',
  },
  cardPeriod: {
    color: '#888',
    fontSize: 14,
    marginBottom: 5,
  },
  cardDescription: {
    color: '#ccc',
    fontSize: 14,
  },
});
